import logo from './logo.svg';
import './App.css';

import {Produktet} from './Produktet';
import {Personat} from './Personat';
import {Kompania} from './Kompania';
import {Navigation} from './Navigation';
import {Home} from './Home';
import {login} from './component';

import {BrowserRouter, Route, Switch} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
    <div className="container-fluid">

     <Navigation/>

     <Switch>
       <Route path='/produktet' component={Produktet} exact/>
       <Route path='/personat' component={Personat}/>
       <Route path='/kompania' component={Kompania}/>
       <Route path='/home' component={Home}/>
       <Route path='/login' component={login}/>


     </Switch>
    </div>
    </BrowserRouter>
  );
}

export default App;
